import React, { useState, useEffect } from "react";
import logo from "./logo.png";
import { useNavigate } from "react-router-dom";
import { motion } from "framer-motion";

const Dashboard = () => {
  const navigate = useNavigate();
  const [documents, setDocuments] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchDocuments = async () => {
      const token = localStorage.getItem("auth_token");
      if (!token) {
        console.error("No token found in local storage");
        return;
      }

      try {
        const response = await fetch("http://192.168.0.114:8000/api/users/documents/", {
          method: "GET",
          headers: {
            "Content-Type": "application/json",
            "Authorization": `Token ${token}`
          },
        });

        if (!response.ok) {
          throw new Error("Failed to fetch documents");
        }

        const data = await response.json();
        console.log(data);
        setDocuments(data);
      } catch (error) {
        console.error("An error occurred while fetching documents:", error);
        setError("Failed to fetch documents. Please try again later.");
      }
    };

    fetchDocuments();
  }, []);

  const handleLogout = async () => {
    const token = localStorage.getItem("auth_token");
    if (!token) {
      console.error("No token found in local storage");
      return;
    }

    try {
      const response = await fetch("http://192.168.0.114:8000/auth/token/logout", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          "Authorization": `Token ${token}`
        },
      });

      if (response.status === 204) {
        // Successfully logged out
        localStorage.removeItem("auth_token");
        navigate("/");
      } else {
        console.error("Logout failed");
      }
    } catch (error) {
      console.error("An error occurred during logout:", error);
    }
  };

  const handleDocumentClick = async (id) => {
    const token = localStorage.getItem("auth_token");
    if (!token) {
      console.error("No token found in local storage");
      return;
    }

    try {
      const response = await fetch(`http://192.168.0.114:8000/api/documents/${id}/`, {
        method: "GET",
        headers: {
          "Content-Type": "application/json",
          "Authorization": `Token ${token}`
        },
      });

      if (!response.ok) {
        throw new Error("Failed to fetch document data");
      }

      const documentData = await response.json();
      navigate(`/Editor/${id}`, { state: { documentData } });
    } catch (error) {
      console.error("An error occurred while fetching document data:", error);
      setError("Failed to fetch document data. Please try again later.");
    }
  };

  return (
    <div
      className="min-h-screen flex flex-col"
      style={{
        backgroundImage: "linear-gradient(120deg, #fdfbfb 0%, #ebedee 100%)",
      }}
    >
      {/* Navigation Bar */}
      <motion.div
        initial={{ opacity: 0, x: -50 }}
        animate={{ opacity: 1, x: 0 }}
        transition={{ duration: 0.5 }}
        className="fixed top-0 w-full bg-white shadow-md p-4 flex justify-between items-center z-10"
      >
        <div className="flex items-center">
          <img
            src={logo} // Replace with your logo URL
            alt="Logo"
            className="h-10 w-20 mr-3"
          />
          <span className="text-2xl font-bold text-black">Dashboard</span>
        </div>
        <div className="flex items-center">
          <span className="text-lg font-semibold text-gray-700 mr-4">
            Username
          </span>{" "}
          {/* Replace 'Username' with actual username */}
          <button
            className="text-white bg-purple-600 hover:bg-purple-700 focus:ring-4 focus:outline-none focus:ring-purple-300 font-medium rounded-lg text-sm px-5 py-2.5 text-center dark:bg-purple-600 dark:hover:bg-purple-700 dark:focus:ring-purple-800"
            onClick={handleLogout}
          >
            Log out
          </button>
        </div>
      </motion.div>

      {/* Main Content */}
      <motion.div
        initial={{ opacity: 0, x: 50 }}
        animate={{ opacity: 1, x: 0 }}
        transition={{ duration: 0.5 }}
        className="pt-20 flex flex-col items-center justify-center flex-1"
      >
        <motion.div
          initial={{ opacity: 0, scale: 0 }}
          animate={{ opacity: 1, scale: 1 }}
          transition={{ duration: 0.5, delay: 0.2 }}
          className="flex justify-center items-center pb-5 pt-5"
        >
          <h1 className="text-4xl font-bold text-black">Documents</h1>
        </motion.div>

        <div className="w-full px-6 grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {error && <div className="text-red-500 text-lg">{error}</div>}
          {documents.map((document) => (
            <motion.div
              key={document.id}
              onClick={() => handleDocumentClick(document.id)}
              className="cursor-pointer bg-white shadow-lg rounded-lg overflow-hidden h-48"
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              <div className="p-4">
                <div className="flex justify-between items-center">
                  <div className="text-2xl font-bold text-gray-800">
                    Document {document.id}
                  </div>
                  <div className="text-3xl">
                    <svg
                      xmlns="http://www.w3.org/2000/svg"
                      width="24"
                      height="24"
                      viewBox="0 0 24 24"
                      fill="none"
                      stroke="currentColor"
                      strokeWidth="2"
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      className="feather feather-file"
                      style={{ color: document.status === "draft" ? "#1E40AF" : "#16A34A" }} // Blue for draft, green for finalized
                    >
                      <path d="M14 2H6a2 2 0 0 0-2 2v16a2 2 0 0 0 2 2h12a2 2 0 0 0 2-2V8z"></path>
                      <polyline points="14 2 14 8 20 8"></polyline>
                    </svg>
                  </div>
                </div>
                <div className="text-sm mt-2">
                  Status: {document.status.charAt(0).toUpperCase() + document.status.slice(1)}
                </div>
              </div>
            </motion.div>
          ))}
        </div>
      </motion.div>
    </div>
  );
};

export default Dashboard;
